<p>We’ve been having trouble controlling our Neo 550 motor. We’ve been using the .set function to control the speed of our motor. However, we’ve noticed that it hasn’t moved. We are using the motor to control an arm that can extend outwards and retract inwards. We tested out another function .setReference and that function was successfully able to extend the arm, but it did not retract the arm when we passed in a negative value. If you have any ideas for ways we can test or have a better way to run our motors, please let us know! Below, I left code, declaring our Neo 550 motor, extending our arm, and retracting our arm, as well as a CAD of the arm.</p>
<pre><code class="lang-auto">      //initializing our extension motor 
      extensionMotor = new CANSparkMax(RobotMap.EXTENSION_MOTOR, CANSparkMax.MotorType.kBrushless);
      extensionMotor.setInverted(true); //extension motor inverted
      extensionMotor.setSmartCurrentLimit(30);
      extensionPIDController = extensionMotor.getPIDController();

      double kP = 6e-5; 
      double kI = 0;
      double kD = 0; 
      double kFF = 0.000015; 
      extensionPIDController.setP(kP);
      extensionPIDController.setI(kI);
      extensionPIDController.setD(kD);
      extensionPIDController.setFF(kFF);

      public void extendArm() { //works
          extensionPIDController.setReference(0.4, CANSparkMax.ControlType.kDutyCycle);
      }

      public void retractArm() { //does not work
          extensionPIDController.setReference(-0.4, CANSparkMax.ControlType.kDutyCycle);
      }


</code></pre>
